  true,\n\t\"url\": null,\n\t\"notes\": \"Adult fathead minnows were exposed to dilutions
  of a historically estrogenic wastewater treatment plant effluent in a 21-d reproduction
  study. This dataset is comprised of a variety of endpoints representing key events
  along adverse outcome pathways linking estrogen receptor activation and other molecular
  initiating events to reproductive impairment. This study demonstrates the value
  of using an integrative approach that encompasses analytical chemistry, in vitro
  bioassays, and in vivo apical and pathway-based approaches with endpoints spanning
  from molecular- (e.g., gene expression) to organismal- (e.g., reproduction) levels
  of biological organization to help infer causal relationships between chemistry
  and potential effects on reproduction.nnThis dataset is associated with the following
  publication:nCavallin , J., K. Jensen , M. Kahl , D. Villeneuve , K. Lee, A. Schroeder
  , J. Mayasich, E. Eid, K. Nelson, R. Milsk, B. Blackwell, J. Berninger , C. LaLone,
  C. Blanksma, T. Jicha , C. Elonen , R. Johnson , and G. Ankley. Pathway-based approaches
  for assessment of real-time exposure to an estrogenic wastewater treatment plant
  effluent on fathead minnow reproduction.   ENVIRONMENTAL TOXICOLOGY AND CHEMISTRY.
  Society of Environmental Toxicology and Chemistry, Pensacola, FL, USA, 35(3): 702-716,
  (2016).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\": [{\n\t\t\"key\":
